        <div>
            <div className="header">
                <Link to={'/'}>Home</Link>
                <Link to={'/login'}>Logout</Link>
            </div>
            <h2>Welcome to the home page</h2>
            <div>

            </div>
        </div>
    );
}

export default Home;
